import React from 'react';

const RealEstatePage = () => {
  return (
    <div>
      <h1>Luxury Real Estate</h1>
      <p>
        Discover our exclusive portfolio of luxury apartments and commercial properties in Dubai. Whether you are
        looking for a new residence or investment opportunities, our curated selection ensures the highest standards of
        quality and prestige.
      </p>
    </div>
  );
};

export default RealEstatePage;
